                'weight_from' => '0',
                'weight_to' => '1',
                'postable' => true,
                'width' => '23',
                'height' => '3',
                'length' => '35',
            ]
        );

        $this->options[] = new Option(
            [
                'code' => 'standard',
                'name' => 'Standard 2-3 days postable',
                'price_drop_off' => '2.69',
                'price_collection' => null,
                'weight_from' => '0',
                'weight_to' => '1',
                'postable' => true,
                'width' => '23',
                'height' => '3',
                'length' => '35',
            ]
        );
